import Event from "./Event";

const Events = () =>
{
    const event = [
        {name: 'Линейка', date: '01.09.2023', time: '09:00', body: 'Долгожданная линейка первоклассников', place: 'Задний двор школы'}
    ]
    return (
        <div>
            <Event name ={event.at(0).name} date = {event.at(0).date}
            time = {event.at(0).time} descripsion = {event.at(0).body}
            place = {event.at(0).place}/>
        </div>
    )
}

export default Events;
